import React from 'react'
import {connect} from 'react-redux'

class Home extends React.Component {
	render() {
		return(
			<div>
				<h1>I am Home</h1>

			</div>
			)
	}
}

const mapStateToProps = state => ({
	auth: state.auth
})

export default connect(mapStateToProps)(Home)
